import React from 'react'

function SingleReview({review}) {
    console.log(review)
  return (
    <div>
        <p>{review.rating}</p>
        <p>{review.review_text}</p>
        <p>{review.created_at}</p>
        <p>{review.user_id}</p>
    </div>
  )
}

export default SingleReview
